import React, { Component } from "react";
import { Link, withRouter } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";

import {
  loginUser,
  logoutUser,
  modificaPatente,
} from "../../actions/authAutentications";
import classnames from "classnames";

//componenti da react-bootstrap
import { Container, Row, Col } from "react-bootstrap";

class ModificaParcheggio extends Component {
  constructor() {
    super();
    this.state = {
      id_utente: "",
      numero_patente: "",
      data_rilascio_patente: "",
      data_scadenza_patente: "",
      ente_rilascio: "",
      type: "text",
      errors: {},
    };
  }

  setType = (tipo) => {
    this.setState({ type: "date" });
  };

  onChange = (e) => {
    this.setState({ [e.target.id]: e.target.value });
  };

  componentWillReceiveProps(nextProps) {
    if (nextProps.errors) {
      this.setState({
        errors: nextProps.errors,
      });
    }
  }

  onSubmit = (e) => {
    e.preventDefault();

    const dataUser = {
      numero_patente: this.state.numero_patente,
      data_rilascio_patente: this.state.data_rilascio_patente,
      data_scadenza_patente: this.state.data_scadenza_patente,
      ente_rilascio: this.state.ente_rilascio,
    };
    this.props.modificaPatente(this.state.id, dataUser);
  };

  render() {
    const { errors } = this.state;
    const { user } = this.props.auth;
    this.state.id = user.id;

    const PL = (
      <div className="container">
        <div class="center" style={{ textAlign: "left" }}>
          <table class="responsive-table">
            <thead>
              <tr>
                <th>Nome</th>
                <th>Indirizzo</th>
                <th>Numero Civico</th>
                <th>Capienza Auto</th>
                <th>Capienza Moto</th>
                <th>Capienza Biciclette</th>
                <th>Capienza Monopattini</th>
              </tr>
            </thead>
            <tbody>
              {parcheggiFiltrati.map((parcheggio) => (
                <tr key={parcheggio._id}>
                  <td>{parcheggio.nome}</td>
                  <td>{parcheggio.indirizzo}</td>
                  <td>{parcheggio.numero_civico}</td>
                  <td>{parcheggio.capienza_auto}</td>
                  <td>{parcheggio.capienza_moto}</td>
                  <td>{parcheggio.capienza_bici}</td>
                  <td>{parcheggio.capienza_monopattini}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    );
    return (
      <Container style={{ marginTop: "12rem", marginBottom: "15rem" }}>
        <div className="row">
          {parcheggio.length === 0 ? "Non ci sono parcheggi" : PL}
        </div>
      </Container>
    );
  }
}

ModificaParcheggio.propTypes = {
  loginUser: PropTypes.func.isRequired,
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  modificaPatente: PropTypes.func.isRequired,
  errors: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  errors: state.errors,
});

export default connect(mapStateToProps, {
  loginUser,
  modificaPatente,
  logoutUser,
})(withRouter(ModificaParcheggio));
